import Customer from './components/Customer';
import './App.css';

const customer = {
  'name' : '홍길동',
  'birthday' : '961222',
  'gender' : '남자',
  'job' : '대학생'

}

function App() {
  return (
    <Customer
            name = {customer.name}
            birthday = {customer.birthday}
            gender = {customer.gender}
            job = {customer.job}
        />
  );
}

export default App;
